import React, {useState} from 'react';
import MainContents from './MainContents/MainContents'
import MenuButton from '../../common/MenuButton/MenuButton'
import './Main.css';

export default function Main({employee}) {

    const [panel, setPanel] = useState('MyInfo');

    return (
        <body>
        <div className="menu">
            <ul>
                <MenuButton menuText={'나의 정보'} menuName={'MyInfo'} setPanel={setPanel}></MenuButton>
                <MenuButton menuText={'상품 개발'} menuName={'DevelopProduct'} setPanel={setPanel}></MenuButton>
                <MenuButton menuText={'요율 결정'} menuName={'Underwrite'} setPanel={setPanel}></MenuButton>
                <MenuButton menuText={'문의 답변'} menuName={'AnswerBoard'} setPanel={setPanel}></MenuButton>
                <MenuButton menuText={'상품 조회'} menuName={'ViewProducts'} setPanel={setPanel}></MenuButton>
            </ul>
        </div>
        <div className="main-contents">
            <MainContents panelName={panel} employee={employee}/>
        </div>
        </body>
    );
}
